<html xmlns="http://www.w3.org/1999/html" ng-csp="ng-csp"></html>
<head>

<body ng-controller="MainCtrl" class="searchy">
<div ng-controller="SearchCtrl" style="" class="searchy-wrapper search-wrapper">

</div>

<script src="vendor/ui-bootstrap/bindHtml.js"></script>
